import './AboutPage.css'; // Estilos específicos da página

function AboutPage() {
  return (
    <div>
      <Nav /> {/* Incluindo o componente de navegação */}
      <section className="about-page">
        <h1>Sobre Nós</h1>
        <p>Conteúdo específico da página sobre...</p>
      </section>
      <Footer /> {/* Incluindo o componente de rodapé */}
    </div>
  );
}

